INSERT INTO `news` (`id`, `date`, `title`, `text`, `link`, `images`) VALUES
(1, 1454404609, 'VK News #1', 'Доброго времени суток!Сегодня поговорим о системе бизнесов, а также функционале данной системы.Система включает в себя удобный и достаточно простой для использования функционал в котором разобраться очень легко, учитывая то, что присутствуют еще и подсказки. После приобретения бизнеса, к примеру 24/7, у владельца появляется возможность устанавливать там мебель по своему усмотрению. То-есть пользоваться фурнитурой в бизнесе, а также приобретать такие мелочи как радио - которое будет функционировать. Владелец может как принимать работников в свой бизнес, так и уволнять их, а также пользоваться счетами предприятия.Система имеет набор стандартных команд, таких как: открытие/закрытие бизнеса, установление цены за вход, класть/снимать деньги с кассы, продать/купить бизнес, назначение/снятие совладельца, редактирование названия бизнеса на свой вкус, выбор оформления и многие другие мелочи.Если идти дальше, то система бизнесов достаточно объемная и включена в единую сеть, в которую входит множество различных бизнесов, которые будут доступны игрокам. Если говрить коротко, то Администрация абсолютно любой бизнес может добавлять прямиком из игры и тот будет приносить прибыль своим владельцам. Будь то - АЗС, СТО в которой можно установить возможность тюнинговать транспорт, закусочные, автосалоны, Pay''N''Spray для ремонта транспорта, спортзалы, спа-салоны, магазины одежды, казино, отели с отдельным функционалом для владельца, различные клубы/бары и т.д, парикмахерские, тату салоны и многое-многое другое. Система насчитывает свыше 55 различных бизнесов и это далеко не предел. Данная цифра постоянно растёт и появляются все новые и новые бизнесы которые станут доступными для игроков.', '', 'https://pp.vk.me/c638822/v638822303/26c2b/dXDfUlnehHE.jpg'),
(2, 1454620355, 'VK News #2', 'Разработка над игровым режимом идёт по плану, а мы продолжаем публиковать системы. Сегодня мы публикуем функционал системы аттача молла. Посетив торговый центр, вы можете заглянуть в любой интересующий вас отдел и подобрать нужню для вас вещь, или же перекусить в закусочных. В торговом центре вы найдете всё необходимое для вашего персонажа, начиная от головных уборов, различных аксессуаров и заканчивая спортивным инвентарем или электроникой в которой вы сможете подобрать даже цвет к вашему мобильному телефону. Данная система проста и удобна в использовании насколько это возможно.', '', 'https://pp.vk.me/c638822/v638822303/26c2b/dXDfUlnehHE.jpg'),
(3, 1454878033, 'VK News #3', 'Сегодня поговорим о системе смерти персонажей, которая состоит из двух стадий.\r\nПервая ступень - это разумеется стадия ранения. Если произошло так, что вашего персонажа ранили при стрельбе, то сперва у него подкашиваются ноги, а затем он падает в анимацию /kostomach. Ваш персонаж будет находится в данной стадии до тех пор, пока его не добьют. В этой стадии у вашего персонажа над головой появляется 3D текст который указывает на ваше ранение, а также возможность посредством команды /damages ID - посмотреть куда вы были ранены и каким оружием. Данная команда доступна как для вас, так и для игроков которые находятся рядом с вами. В стадии ранения, мы вас не ограничиваем и у вас имеется возможность отыгрывать ситуацию в локальные чаты. В случае, если персонаж пролежал 60 секунд на земле, его никто не вылечил или не добил, то перед ним появляется команда ''/acceptdeath'' набрав которую тот появится в госпитале, где будет списана небольшая сумма за лечение.\r\n\r\nВторая ступень - это стадия смерти вашего персонажа. Если произошло так, что персонажа изначально убили или добили после ранения, то у него над головой аналогично появляется 3D текст о его смерти, а также возможность посмотреть каким оружием и куда он был ранен, а после убит. После смерти - персонаж отправляется на место установленного вами спавна.', '', 'https://pp.vk.me/c638822/v638822303/26c2b/dXDfUlnehHE.jpg'),
(4, 1455226933, 'VK News #4', 'Доброго времени суток! Поговорим о работе механика, таксиста и дальнобойщика. \r\n\r\nЕсли получить лицензию таксиста в автошколе, то у вас появится возможность работать таксистом на себя. Для этого нужно лишь приобрести один из двух автомобилей такси в автосалоне и устроиться на работу. Функционал таксиста включает в себя возможность выходить/уходить на/с дежурства, принимать поступающие звонки с последующем выездом на них, устанавливать таксу за проезд в транспорте, включать/отключать счётчик и так-далее. Также, если у вас есть желание и планы, вы можете открыть свой собственный таксопарк, накупить автомобилей и работать как единая система.\r\n\r\nЧтобы работать механиком, необходимо приобрести автомобиль марки "Tow Truck" в автосалоне и устроиться на работу. Прежде чем приступить к работе, необходимо закупить компоненты в указанном на радаре месте, а после уже приступать. В функционал механиков входит возможность чинить транспорт полностью или частично. К примеру починить только проколотые колеса, отремонитировать двигатель который вышел из строя после серьезных повреждений транспорта, провести частично кузовные работы, а также заправить бак, отбуксировать транспорт или перекрасить его в другой цвет. Но и на этом работа механика не ограничивается и при желание, также как и с такси вы можете открыть свое собственно СТО, набрать персонал, закупить автомобили и работать по правилам которые вы устанавливаете уже сами.\r\n\r\nВ работе дальнобойщика, вам предстоит выезжать в рейсы и развозить различные грузы. Прежде чем приступить к работе, вам нужно найти свободные, расставленные автомобили по Лос-Сантосу, или же приобрести свой грузовик в автосалоне. После этого нужно набрать определенную команду и можно выезжать в рейс и развозить товар по чекпоинтам. В функционал входит возможность начать/остановить работу, выгружать груз, обновлять чекпоинты, останавливать миссию и повышать свой навык, тем самым получая с каждым приобретенным навыком более высокую зарплату. \r\n\r\nНа этом список не окончен и на сервере присутствуют другие способы заработка, как легальные так и нелегальные, как для обычных игроков так и для тех кто состоит в официальных криминальных фракциях.', '', 'https://pp.vk.me/c638822/v638822303/26c2b/dXDfUlnehHE.jpg'),
(5, 1459106958, 'VK News #5', 'Привет-привет!) Давненько тут не было новостей. \r\nПосле тестирования игрового режима командой, мы выявили баги которые были исправлены. Завтра/послезавтра начинаем еще одно повтороное тестирование режима.\r\n\r\n* Некоторые доработки/исправления\r\n----------------------------------\r\n- Фикс найденных багов\r\n- Оптимизация режима (работа над лагами)\r\n- Отлажены некоторые системы\r\n- Обновление системы транспорта\r\n- Обновление /damages\r\n- Обновление системы урона\r\n- При выходе из афк, теперь отображается время, которое провел игрок в афк(можно отключить/включить через /togafk)\r\n- Обновление по анимациям\r\n- Добавлен еще новый маппинг\r\n- Добавлена система личных аудиозаписей\r\n- Обновлена работа механика/таксиста\r\n- Админское', '', 'https://pp.vk.me/c638822/v638822303/26c2b/dXDfUlnehHE.jpg');
