INSERT INTO `tests` (`id`, `text`, `ans_1`, `ans_2`, `ans_3`, `ans_4`, `right_answer`) VALUES
(1, 'Преувеличение физических и психологических возможностей персонажа, а так же игра в свою пользу без какого либо шанса для второй ', 'Metagaming', 'Powergaming', 'Revenge-kill', 'Player Kill', 2),
(2, 'Вы осознаете, что вторая сторона ролевой ситуации грубо нарушает игровые правила. Ваши действия?', 'Откажусь играть ситуацию, ведь она явно с нарушением правил.', 'Выйду из игры.', 'Спокойно доиграю ситуацию, а после оставлю жалобу в соответствующем разделе.', 'Устрою негодяю суд Линча.', 3),
(3, 'Какие игровые модификации разрешены на сервере?', 'CLEO-починка автомобиля.', 'ELM, дырки от пуль, перезарядка оружия, отражение задних фар на земле.', 'CLEO Wallhack.', 'CLEO CamHack, CamHunt во время игрового процесса.', 2),
(4, 'В каком случае вы можете пополнить количество HP во время драки/перестрелки?', 'Пополнение HP во время драк/перестрелок разрешено при условии, что вы находитесь далеко от места событий.', 'Пополнение HP во время драк/перестрелок строго запрещено.', 'Имею право пополнить HP при любой ситуации.', 'Правилами не регламентируется.', 2),
(5, 'Разрешено ли использовать Bunnyhop для более быстрого передвижения на сервере?', 'Только в том случае, если я очень сильно спешу.', 'Нет, так как это запрещено правилами сервера.', 'Разрешено, пока администрация не видит.', 'В том случае, если рядом со мной нет ни единого игрока.', 2),
(6, 'Вы заметили, как незнакомый игрок назвал вас по имени. Ваши действия?', 'Предположу, что данный игрок киллер и сразу же застрелю его.', 'Спокойно разъясню игроку в OOC, что он поступил некорректно', 'Начну ругаться и оскорблять данного игрока в PM.', 'Буду многократно жаловаться в PM администрации.', 2),
(7, 'Какой язык используется на сервере?', 'Русский.', 'Русский и украинский.', 'Языки стран СНГ.', 'Английский.', 1),
(8, 'Какова политика сервера по отношению к использованию ООС-чата?', 'Использование OOC-чата разрешено только при условии крайней необходимости.', 'OOC-чат полностью запрещен на сервере.', 'Разрешено использовать OOC-чат наравне с игровым – IC-чатом.', 'Имеете право использовать, когда захотите.', 1),
(9, 'В каких случаях вы имеете право отправить администратору PM-сообщение?', 'Если вам срочно необходима помощь.', 'Если сообщение не касается администрирования проекта.', 'Писать PM-сообщения администрации проекта строжайше запрещено.', 'Имеете право обратиться в любое время и по любым вопросам.', 2),
(10, 'Какова максимальная сумма для ограбления, не требующая разрешения администрации?', '$50.000.', '$2.500. ', '$1.000.', '$5.000', 3),
(11, 'Разрешено ли вам провоцировать полицию на погоню', 'Строжайше запрещено. За нарушением данного правила может последовать наказание', 'Разрешено, если на сервере очень скучно', 'Разрешено, но зависит от ситуации', 'Правилами не регламентируется', 1),
(12, 'Каким из перечисленных ниже способов вы можете уйти от полицейской погони?', 'В голливудском стиле спрыгнуть с моста в воду', 'Взорваться в собственном автомобиле', 'Выйти из игры.', 'Cбросить преследователей с хвоста и затеряться в переулках.', 4),
(13, 'Разрешено ли убийство жертвы после ее ограбления?', 'Естественно, я никогда не оставляю свидетелей', 'Только в том случае, если жертва нанесла мне тяжкое оскорбление или оказала сопротивление.', 'Разрешено в том случае, если рядом нет посторонних свидетелей.', 'Правилами не регламентируется', 2),
(14, 'В каком из перечисленных ниже мест разрешено провести ограбление?', 'Здание ЛСПД – площадь Першинг.', 'Аэропорт Фрэнсис Интернэшнл.', 'Автосалон "Гротти".', 'Паркинг пиццерии Айделвуда.', 4),
(15, 'В чем заключается главное отличие Character Kill от Player Kill', 'Character Kill можно наблюдать заметно чаще, чем Player Kill.', 'Возможность продолжить отыгрыш своей роли после технической смерти персонажа.', 'Отличия настолько незначительны, что в объяснении нет смысла', 'Необходимость оставить свою роль и начать новую', 4),
(16, 'Разрешено ли использование программы QuickBinder и ее аналогов на сервере?', 'Разрешено, если не предоставляет одной из сторон заметное преимущество.', 'Запрещено.', 'Только лишь для фракции LSPD.', 'Правилами не регламентируется.', 1),
(17, 'Разрешено ли поджидать игроков в AFK?', 'Запрещено.', 'Правилами не регламентируется.', 'Разрешено.', 'Если игрок находится за пределами города, тогда разрешено.', 1),
(18, 'Можно ли использовать имена знаменитостей?', 'Запрещено.', 'Да, разрешено.', 'Разрешено использование имен малоизвестных знаменитостей.', 'Если это не касается звезд российской эстрады.', 1),
(19, 'Какова политика сервера по отношению к действиям в локальный чат?', 'Использование действий в локальный чат строжайше запрещено.', 'Разрешено использование небольших действий.', 'Разрешено в том случае, если вы играете в небольшой компании с друзьями.', 'Правилами не регламентируется.', 2),
(20, 'Какова политика сервера по отношению к передаче денежных средств/имущества на второстепенные аккаунты?', 'Запрещено.', 'Разрешено.', 'Разрешено, если получить одобрение от администрации.', 'Правилами не регламентируется.', 3),
(21, 'С какого уровня разрешены ограбления?', 'Первый уровень.', 'Третий уровень.', 'Пятый уровень.', 'Ограничения отсутствуют. Могу грабить, когда захочу.', 2),
(22, 'Что означает IC?', 'Inglewood California.', 'iCloud.', 'In Character.', 'Ice Cream.', 3),
(23, 'Для чего по-вашему необходим форум?', 'Реклама игрового сервера.', 'Необходим для быстрого получения уровня игры', 'Необходим для получения важной информации и общения.', 'Для выкладывания фотографий из реальной жизни.', 3),
(24, 'Разрешено ли оскорблять игроков в OOC?', 'Строго запрещено.', 'Имею полное право, если же меня оскорбили.', 'Всегда и в любое время.', 'В том случае, если на сервере отсутствует администрация.', 1),
(25, 'Полицейский останавливает вас без какой-либо причины, что вы предпримите?', 'Начну расспрашивать обо всем в /b чат.', 'Буду придерживаться своей роли, остановлюсь и начну играть.', 'Выйду из игры.', 'Оскорблю полицейского в PM и попытаюсь скрыться.', 2),
(26, 'Какая из нижеприведенных реклам является корректной и реалистичной?', 'Макеты оружия и лучшая белая мука. Звоните!', 'Куплю дом.', 'Продам а/м Хантли, хорошее состояние, красный металлик, цена договорная.', 'Всем привет! Меня зовут Алекс!', 3),
(27, 'Вы стали свидетелем, как полиция преследует автомобиль с подозреваемыми. Ваши действия?', 'Открою огонь по офицерам, тем самым поддержав преступников.', 'Приму участие в преследовании, всячески мешая полиции.', 'Смещусь вправо к обочине и пропущу автомобили не создавая препятствий.', 'Окажу поддержку офицерам полиции и начну ловить преступника.', 3),
(28, 'В каком из чатов допустимы смайлы?', 'OOC-чаты и SMS.', 'В любой из чатов.', '/low', '/ad.', 1),
(29, 'Так вышло, что вашего персонажа арестовали. Ваши действия?', 'Продолжу игру исходя из игровых правил и буду придерживаться роли.', 'Буду просить в PM, чтобы полицейские выпустили меня.', 'Выйду из игры, ибо ситуация скучная и не интересная.', 'Начну оскорблять полицейских в OOC-чат.', 1),
(30, 'Можете ли вы сказать "lol" во время телефонного разговора IC?', 'Конечно же могу.', 'Безусловно, если разговор показался мне забавным и смешным.', 'Нет, ибо английский и аббревиатуры категорически запрещены IC.', 'Могу лишь в том случае, если персонаж является иностранцем.', 3),
(31, 'Администратор оказался несправедлив, как вы поступите?', 'Буду долго и упорно ругаться с ним посредством PM.', 'Выйду из себя и начну написывать грозные сообщения в /report.', 'Буду угрожать администратору расправой в реальной жизни.', 'Оформлю жалобу на форуме или же напишу ответственному за персонал.', 4),
(32, 'Вам стало скучно и вы решили пострелять. Ваши действия?', 'Использую маску, скрыв никнейм, и начну убивать всех на своем пути.', 'Перейду на специальный сервер с режимом DM/TDM.', 'Буду убивать лишь тех, кого я очень сильно ненавижу, например, полицейских.', 'Буду поджидать игроков в автосалоне "Гротти", а после убивать прямо на входе.', 2);
INSERT INTO `test_text` (`id`, `text`) VALUES
(1, 'Представьте, что ваш автомобиль был остановлен сотрудниками полиции за какое-либо нарушение. У вас есть небольшие запасы наркотических веществ в кармане. Ваши действия?'),
(2, 'Прогуливаясь по злополучному переулку, на Вас внезапно напали люди и угрожая ножом, пытаются ограбить вас. Ваши действия?'),
(3, 'Дайте полное понятие термина Metagaming с наглядными примерами.'),
(4, 'Опишите, где запрещено совершать преступления/ограбления и почему?'),
(5, 'Что такое Player Kill(PK) и Character Kill(CK)?\r\n'),
(6, 'Что такое [Зеленая зона] и где она находится?'),
(7, 'Вы увидели, что другой игрок пользуется багом сервера или чит-программой. Ваши действия?'),
(8, 'Дайте полное понятие термина Powergaming с наглядными примерами.'),
(9, 'Представьте ситуацию, что ваш персонаж был свидетелем аварии, в которой на ваших глазах пострадал человек. Мотоциклист слетел со своего байка и приземлился на дорогу. Ваши действия?'),
(10, 'Ситуация такова, что вы стали свидетелем, как двое неизвестных разрисовывали баллончиками одно из зданий. Время уже позднее и улицы стали практически пустыми. Что предпринял бы ваш персонаж?');
