INSERT INTO `ucpnews` (`id`, `date`, `title`, `text`, `link`, `img`, `tag`, `author`) VALUES
(2, '2017-02-12 12:52:00', ' Покупка автомобилей ', 'Купить транспортное средство вы можете в автосалоне Гротти. Все автомобили распределены на несколько классов. При покупке автомобиля вы можете сразу-же добавить к нему необходимые апгрейды, что отразиться на конечной стоимости автомобиля. Докупить любые улучшения можно и после покупки самого автомобиля.', 'https://vk.com/lsl_rp?w=wall-129863557_253', '', 'Игровой мод', 'ri4erson'),
(3, '2017-02-16 16:06:09', 'Тестирование мода и краткий список обновлений', 'В данный момент мы проводим тестирование игрового мода с бета-тестерами, а так же занимаемся фиксами багов и легкими обновлениями. В целом по тесту всё очень даже неплохо и баги в основном если и появляются, то незначительные и их достаточно мало, что не может не радовать. <br/> Ниже вы можете посмотреть список обновлений игрового мода.', 'https://vk.com/lsl_rp?w=wall-129863557_257', '', 'Проект', 'Simba'),
(4, '2017-02-27 14:23:00', 'Завершение бета теста', 'Всем привет! Мы рады сообщить вам о том, что закрытый бета-тест подходит к своему завершению.  <br/><br/>Мы провели несколько итераций, в ходе которых выявили недочеты в моде. За время тестирования не было выявлено масштабных багов, в большинстве случаев бета-тестеры оставляли информацию об орфографических ошибках и недочетах.  <br/>В данный момент мы исправляем баги с последнего дня тестирования, а так же обновляем и пополняем мод приятными мелочами. После этого будет обнуление всего имущества, которое осталось после бета-тестирования. Мы попросили бета-тестеров оставить свои отзывы впечатления по тестированию игрового мода. Ниже будут опубликованы их цитаты без каких-либо правок и изменений. Что можно сказать по итогу? Проект почти готов к открытию, осталось немного работы по моду и мы сможем сообщить дату его открытия. Это произойдет в самое ближайшее время. А пока сообщаем вам информацию о том, что уже завтра-послезавтра мы открываем форум для всех желающих, а также начнем проверять заявки в обновленной UCP еще через день. Мы надеемся, что вместе у нас получится реализовать достойную площадку для ролевой игры!', 'https://vk.com/lsl_rp?w=wall-129863557_282', '', 'Проект', 'ri4erson'),
(5, '2017-03-06 22:22:14', 'Открытие проекта', 'Добрый вечер. Мы рады сообщить вам о том, что в субботу 11.03.17 состоится долгожданное открытие игрового сервера. От лица команды проекта, хотим поблагодарить всех вас за терпение, помощь и поддержку в создании данного проекта, в реализации некоторых вещей которые создавались совместными усилиями, а так же надеемся на дальнейшее взаимопонимание и сотрудничество. <br/><br/>В данный момент проводятся обновления и усовершенствования как над веб-ресурсами, так и над игровым режимом. На протяжении прошлой недели, мы успели обновить маппинг, упростили функционал аренды домов, добавили возможность располагать уличный маппинг рядом с вашими домами, провели работы над античитом, обновли систему банкоматов, систему ранений и их стадий, протестировали и продолжаем тестировать новую систему наркотиков, написали функционал для фракции Los Santos City Government и многое другое. <br/><br/>Дата открытия запланирована на 11 марта, 2017 года. Точное время будет указано в этот же день. Сейчас для вас доступна "Панель управления персонажами" и все желающие могут проходить регистрацию и создавать персонажей.', 'http://forum.ls-life.ru/viewtopic.php?f=8&p=9225#p9225', '<img src="https://cs7052.userapi.com/c638823/v638823303/266ba/N25ZUSwYkNw.jpg"> ', '', 'Simba'),
(6, '2017-03-16 22:24:34', 'Старт развития проекта, фидбек от игроков', '<br/>На нашем форуме появилась публикация от команды комьюнити-менеджеров, в которой мы хотим получить фидбек от каждого игрока, который может повлиять на развитие проекта в целом.Нам важно получить развернутое мнение, чтобы начать работу над ошибками и радовать Вас стабильной, качественной и полноценной игрой.', 'http://forum.ls-life.ru/viewtopic.php?f=177&t=1117', '<img src="http://i.imgur.com/n8Tz93K.jpg">', '', 'ri4erson'),
(23, '2017-03-20 15:51:34', 'Ближайшие планы на изменения в проекте', '<br/>Добрый день, прочитав все отзывы в первой публикации, хочу дать ответы на основные претензии игроков и расписать ветви развития проекта по определенным направлениям. Наша главная задача на данный момент заключается в том, чтобы зарекомендовать данный проект как стабильный и качественный сервер для ролевой игры. Администрация проекта готова идти на контакт и прислушиваться к мнению каждого игрока.  <br/>Перейдем непосредственно к ответам на основные тезисы, с предыдущей публикации.', 'http://forum.ls-life.ru/viewtopic.php?f=177&t=1351', '<img src="http://i.imgur.com/DUI7iwk.png">', '', 'ri4erson');
